--
-- Name: events Anyone can view active events; Type: POLICY; Schema: public; Owner: -
--

CREATE POLICY "Anyone can view active events" ON public.events FOR SELECT USING ((is_active = true));


--
-- Name: event_images Anyone can view event images; Type: POLICY; Schema: public; Owner: -
--

CREATE POLICY "Anyone can view event images" ON public.event_images FOR SELECT USING (true);


--
-- Name: events Only admins and teachers can create events; Type: POLICY; Schema: public; Owner: -
--

CREATE POLICY "Only admins and teachers can create events" ON public.events FOR INSERT WITH CHECK ((EXISTS ( SELECT 1
   FROM public.users
  WHERE ((users.id = auth.uid()) AND (users.role = ANY (ARRAY['Admin'::text, 'Teacher'::text]))))));


--
-- Name: event_images Only admins and teachers can manage event images; Type: POLICY; Schema: public; Owner: -
--

CREATE POLICY "Only admins and teachers can manage event images" ON public.event_images USING ((EXISTS ( SELECT 1
   FROM public.users
